Here's the main code of the project, which you should put in the azle_hello_world/src/index.ts file of your canister: import { Canister, query, text, update, Void } from 'azle/experimental'; // This is a global variable that is stored on the heap
let message = ''; export default Canister({ // Query calls complete quickly because they do not go through consensus getMessage: query([], text, () => { return message; }), // Update calls take a few seconds to complete // This is because they persist state changes and go through consensus setMessage: update([text], Void, (newMessage) => { message = newMessage; // This change will be persisted })
}); Let's discuss each section of the code. import { Canister, query, text, update, Void } from 'azle/experimental'; The code starts off by importing Canister, query, text, update and Void from azle. The azle module provides most of the Internet Computer (IC) APIs for your canister. // This is a global variable that is stored on the heap
let message = ''; We have created a global variable to store the state of our application. This variable is in scope to all of the functions defined in this module. We have set it equal to an empty string. export default Canister({ ...
}); The Canister function allows us to export our canister's definition to the Azle IC environment. // Query calls complete quickly because they do not go through consensus
getMessage: query([], text, () => { return message;
}), We are exposing a canister query method here. This method simply returns our global message variable. We use a CandidType object called text to instruct Azle to encode the return value as a Candid text value. When query methods are called they execute quickly because they do not have to go through consensus. // Update calls take a few seconds to complete
// This is because they persist state changes and go through consensus
setMessage: update([text], Void, (newMessage) => { message = newMessage; // This change will be persisted
}); We are exposing an update method here. This method accepts a string from the caller and will store it in our global message variable. We use a CandidType object called text to instruct Azle to decode the newMessage parameter from a Candid text value to a JavaScript string value. Azle will infer the TypeScript type for newMessage. We use a CandidType object called Void to instruct Azle to encode the return value as the absence of a Candid value. When update methods are called they take a few seconds to complete. This is because they persist changes and go through consensus. A majority of nodes in a subnet must agree on all state changes introduced in calls to update methods. That's it! We've created a very simple getter/setter Hello World application. But no Hello World project is complete without actually yelling Hello world! To do that, we'll need to setup the rest of our project.

