Created with the update function Read-write Executed on many nodes Consensus Latency ~2-5 seconds 20 billion Wasm instruction limit 4 GiB heap limit 96 GiB stable memory limit ~900 updates per second per canister Update methods are similar to query methods, but state changes can be persisted. Here's an example of a simple update method: import { Canister, nat64, update } from 'azle/experimental'; let counter = 0n; export default Canister({ increment: update([], nat64, () => { return counter++; })
}); Calling increment will return the current value of counter and then increase its value by 1. Because counter is a global variable, the change will be persisted to the heap, and subsequent query and update calls will have access to the new counter value. Because the Internet Computer (IC) persists changes with certain fault tolerance guarantees, update calls are executed on many nodes and go through consensus . This leads to latencies of ~2-5 seconds per update call. Due to the latency and other expenses involved with update methods, it is best to use them only when necessary. Look at the following example: import { Canister, query, text, update, Void } from 'azle/experimental'; let message = ''; export default Canister({ getMessage: query([], text, () => { return message; }), setMessage: update([text], Void, (newMessage) => { message = newMessage; })
}); You'll notice that we use an update method, setMessage, only to perform the change to the global message variable. We use getMessage, a query method, to read the message. Keep in mind that the heap is limited to 4 GiB, and thus there is an upper bound to global variable storage capacity. You can imagine how a simple database like the following would eventually run out of memory with too many entries: import { Canister, None, Opt, query, Some, text, update, Void
} from 'azle/experimental'; type Db = { [key: string]: string;
}; let db: Db = {}; export default Canister({ get: query([text], Opt(text), (key) => { const value = db[key]; return value !== undefined ? Some(value) : None; }), set: update([text, text], Void, (key, value) => { db[key] = value; })
}); If you need more than 4 GiB of storage, consider taking advantage of the 96 GiB of stable memory. Stable structures like StableBTreeMap give you a nice API for interacting with stable memory. These data structures will be covered in more detail later . Here's a simple example: import { Canister, Opt, query, StableBTreeMap, text, update, Void
} from 'azle/experimental'; let db = StableBTreeMap<text, text>(0); export default Canister({ get: query([text], Opt(text), (key) => { return db.get(key); }), set: update([text, text], Void, (key, value) => { db.insert(key, value); })
}); So far we have only seen how state changes can be persisted. State changes can also be discarded by implicit or explicit traps. A trap is an immediate stop to execution with the ability to provide a message to the execution environment. Traps can be useful for ensuring that multiple operations are either all completed or all disregarded, or in other words atomic. Keep in mind that these guarantees do not hold once cross-canister calls are introduced, but that's a more advanced topic covered later . Here's an example of how to trap and ensure atomic changes to your database: import { Canister, ic, Opt, query, Record, StableBTreeMap, text, update, Vec, Void
} from 'azle/experimental'; const Entry = Record({ key: text, value: text
}); let db = StableBTreeMap<text, text>(0); export default Canister({ get: query([text], Opt(text), (key) => { return db.get(key); }), set: update([text, text], Void, (key, value) => { db.insert(key, value); }), setMany: update([Vec(Entry)], Void, (entries) => { entries.forEach((entry) => { if (entry.key === 'trap') { ic.trap('explicit trap'); } db.insert(entry.key, entry.value); }); })
}); In addition to ic.trap, an explicit JavaScript throw or any unhandled exception will also trap. There is a limit to how much computation can be done in a single call to an update method. The current update call limit is 20 billion Wasm instructions . If we modify our database example, we can introduce an update method that runs the risk of reaching the limit: import { Canister, nat64, Opt, query, StableBTreeMap, text, update, Void
} from 'azle/experimental'; let db = StableBTreeMap<text, text>(0); export default Canister({ get: query([text], Opt(text), (key) => { return db.get(key); }), set: update([text, text], Void, (key, value) => { db.insert(key, value); }), setMany: update([nat64], Void, (numEntries) => { for (let i = 0; i < numEntries; i++) { db.insert(i.toString(), i.toString()); } })
}); From the dfx command line you can call setMany like this: dfx canister call my_canister setMany '(10_000)' With an argument of 10_000, setMany will fail with an error ...exceeded the instruction limit for single message execution. In terms of update scalability, an individual canister likely has an upper bound of ~900 updates per second .

