Examples: http_counter import { blob, bool, Canister, Func, nat16, None, Opt, query, Record, text, Tuple, Variant, Vec
} from 'azle/experimental'; const Token = Record({ // add whatever fields you'd like arbitrary_data: text
}); const StreamingCallbackHttpResponse = Record({ body: blob, token: Opt(Token)
}); export const Callback = Func([text], StreamingCallbackHttpResponse, 'query'); const CallbackStrategy = Record({ callback: Callback, token: Token
