Your project is just a directory with a dfx.json file that points to your .ts or .js entrypoint. Here's what your directory structure might look like: hello_world/
|
├── dfx.json
|
└── src/ └── api.ts For an HTTP Server canister this would be the simplest corresponding dfx.json file: { "canisters": { "api": { "type": "azle", "main": "src/api.ts", "custom": { "experimental": true, "candid_gen": "http" } } }
} For a Candid RPC canister this would be the simplest corresponding dfx.json file: { "canisters": { "api": { "type": "azle", "main": "src/api.ts" } }
} Once you have created this directory structure you can deploy to mainnet or a locally running replica by running the dfx deploy command in the same directory as your dfx.json file.

