When working with res.json you may run into errors because of attempting to send back JavaScript objects that are not strictly JSON. This can happen when trying to send back an object with a BigInt for example. Azle has created a special function called jsonStringify that will serialize many ICP-specific data structures to JSON for you: import { jsonStringify } from 'azle/experimental';
